const Row = (props) => {
  return (
    <div className="row">
      <div className="col-1">
        <div className="pre-head">{props.preHead}</div>
        <h1 className="head">{props.head}</h1>
        <div className="desc">
          <p>{props.desc1}</p>
          <p>{props.desc2}</p>
          <p>{props.desc3}</p>
        </div>
      </div>
      <div className="col-2">
        <img src={props.img} alt="Phone with food" />
      </div>
    </div>
  );
};

export default Row;
